def prime_fib(n: int) -> int:
    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def fibonacci(n):
        a, b = 0, 1
        while a < n:
            yield a
            a, b = b, a + b

    for i, fib_num in enumerate(fibonacci(1000000)):
        if is_prime(fib_num):
            if i == n - 1:
                return fib_num

