def minPath(grid, k):
    def dfs(x, y, path, steps):
        if steps == k:
            return path
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]) and (nx, ny) not in path:
                path.append(grid[nx][ny])
                result = dfs(nx, ny, path, steps + 1)
                if result:
                    return result
                path.pop()
        return None

    min_path = None
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            result = dfs(i, j, [grid[i][j]], 1)
            if result and (min_path is None or result < min_path):
                min_path = result
    return min_path

